import React, { Component } from 'react';
import styled, { css } from 'styled-components';
import './App.css';

const Input = styled.input`
    margin: 20px;
    width: 30vw;
    height: 2vw;
    font-size: 20px
`

class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            currentEuroValue: 0
        }
    }

    render() {
        return (
            <form>
                <Input onClick={this.handleClick} type="text"></Input>
            </form>
        )
    }
}

export default App;
